        <img class="icon" src="public/images/icon-2.png" alt="image icon-1"/>

      </div>
      <div class="item">
        <img class="icon" src="public/images/icon-3.png" alt="image icon-1"/>

          <h4 class="total-km" id="kmH">80 km/h</h4>
          <p class="local-km" id="kmHinfor">Sau khi hoàn chỉnh toàn tuyến sẽ là 120km/h</p>
        </div>
      </div>
      <div class="item">
        <img class="icon" src="public/images/icon-4.png" alt="image icon-1"/>
        <div class="item-content">
          <h4 class="total-km" >Thời gian xây dựng</h4>
          <p class="local-km" id="time">01/07/2021 - 09/2023</p>
